import React from 'react';
import { Button, Grid } from '@material-ui/core';
import {
  createStyles,
  withStyles,
  makeStyles,
  Theme,
  ThemeProvider,
} from '@material-ui/core/styles';
import './Header.css';
import { green, purple } from '@material-ui/core/colors';

const ColorButton = withStyles((theme) => ({
  root: {
    color: theme.palette.getContrastText(purple[500]),
    backgroundColor: black,
    '&:hover': {
      backgroundColor: purple[700],
    },
  },
}))(Button);

export default function Header() {
    return (
        <Grid container spacing={0} className="grid">
            <Grid item xs={12} sm={6} className="images">
                <img src="/images/MathLaw.PNG"></img>
                <img src="/images/logo.PNG" style={{marginBottom: "33px", marginLeft: "30px"}}></img>
            </Grid>
            <Grid item xs={12} sm={6}>
                <ColorButton>Sign Up</ColorButton>
                <ColorButton>Log In</ColorButton>
            </Grid>
        </Grid>
    );
}
